import React, { Component } from 'react';

import Navigation from "./Navigation";
import LearnPage from './LearnPage';
import UnderstandPage from './UnderstandPage';
import ReviewPage from './ReviewPage';
import IntroBody from './Landing_Page/IntroBody';

export default class LandingPage extends Component {
  constructor () {
    super ();
    this.state= {
      questReview: []
    }
  }

  handleLearn() {
    return(
      <LearnPage />
    )
  }

  handleQuiz() {
    return (
      <UnderstandPage />
    )
  }

  handleReview() {
    return (
      <ReviewPage />
    )
  }

  render () {
    return(
      <div className="layout">
        <header>
          <Navigation />
        </header>
        <section className="landing__body">
          <IntroBody />
          <nav className="landing__nav">
            <button className="landing__btn learn">Learn 
              <i class="fas fa-brain"></i></button>
            <button className="landing__btn quiz">Quiz 
              <i class="fas fa-pen-square"></i></button>
            <button className="landing__btn review">Review 
              <i class="fas fa-clipboard-list"></i></button>
          </nav>
        </section>
      </div>
    )
  }
}
